import { Modal } from "react-bootstrap";
// import { Button } from "@material-ui/core";
// import { Logo } from '../../../resources/img/'
import { useNavigate } from "react-router-dom";
import { useState } from "react";
import './modalLogin.css'
import axiosInstance from "../../services/LoginService";


const ModalReg = (props) => {
  let navigate = useNavigate();
  const initialFormData = Object.freeze({
		email: '',
		username: '',
		password: '',
	});

  const [formData, setFormData] = useState(initialFormData);

  const handleChange = (e) => {
		setFormData({
			...formData,
			// Trimming any whitespace
			[e.target.name]: e.target.value.trim(),
		});
	};

	const handleSubmit = (e) => {
		e.preventDefault();
		console.log(formData);

		axiosInstance
			.post(`user/create/`, {
				email: formData.email,
				user_name: formData.username,
				password: formData.password,
			})
			.then((res) => {
				history.push('/login');
				console.log(res);
				console.log(res.data);
			});
	};


  return (
    <div className="containerModal">
      <Modal
      {...props}
      className="modal"
      size="md"
      aria-labelledby="contained-modal-title-vcenter modal-sm"
      backdrop="static"
      keyboard={false}
      centered
    >
        <Modal.Header closeButton>
        <Modal.Title id="contained-modal-title-vcenter">Register</Modal.Title>
      </Modal.Header>
      <Modal.Body>
        <div className="container-modal">
          <div className="brand-logo"></div>
          <div className="brand-title text-center">Gather</div>
          <div className="inputs mx-5">
            <label>USERNAME</label>
            <input type="text" placeholder="Username" />
            <label>EMAIL</label>
            <input type="email" placeholder="correo@mail.com" />
            <label>PASSWORD</label>
            <input type="password" placeholder="Mínimo 6 caracteres" />
            <button type="submit"  onClick={() => {
                navigate("/home");
              }}>REGISTER</button>
          </div>
        </div>
      </Modal.Body>
      <Modal.Footer>
      </Modal.Footer>
    </Modal>
    </div>
  );
};

export default ModalReg;
